            Plotly.update("plotly-figure", data, layout);  // Update the plot
            var newOpacity = allVisible ? 1 : 0.5;
            var newColor = allVisible ? "black" : "gray";
            var legendItems = document.querySelectorAll(".legend-item");
            legendItems.forEach(function(item) {
                item.querySelector(".legend-color-box").style.opacity = newOpacity;
                item.style.color = newColor;
            });
        };
        legendDiv.appendChild(legendItem);
    });
</script>
</body>
</html>
